import Screen from '../Screen';
import React, { FC, useState, useEffect } from 'react';
import { FlatList } from 'react-native';
import styled from 'styled-components/native';
import { useParams } from 'react-router-dom';
import textAPI from 'api/textAPI';
import CryptoJS from 'crypto-js';
import Part6Item from './shared/Part6Item';
import Footer from 'components/Footer';
import { getPart } from 'store/selectors/selectors';
import { updatePartAction } from 'store/actionTypes/actionType';
import { useDispatch, useSelector } from 'react-redux';

const TestFlatList = styled(FlatList as new () => FlatList<string>)`
  width: 100%;
  height: 100%;
`;

const Part6: FC = () => {
  const [testList, setTestList] = useState<any[]>([]);
  const [correctNumber, setCorrectNumber] = useState<number>(-1);
  const [totalNumber, setTotalNumber] = useState<number>(-1);

  const dispatch = useDispatch();
  const { testNumber } = useParams();
  const testName = `test${testNumber}`;
  const part6  = useSelector(getPart(testName, 'part6'));
  useEffect(() => {
    getData(testNumber, part6);
  }, []);

  const getData = async (testNumber: number, part5: any) => {
    const itemTypes: any[] = (part5 && part5.questions && part5.questions.length > 0) ? part5.questions : [];
    if (itemTypes.length > 0) {
      setTestList(itemTypes);
    } else {
      const data = await textAPI.get(testNumber, 6);
      const plainData = CryptoJS.AES.decrypt(data, 'thieumao').toString(CryptoJS.enc.Utf8);
      const json = JSON.parse(plainData);
      setTestList(json);
      updateDatabase(testName, json);
    }
  };

  const updateDatabase = async (testName: string, part6Questions: any[]) => {
    const part6Detail = {
      name: 'Part 6',
      questions: part6Questions,
    };
    dispatch(updatePartAction(testName, 'part6', part6Detail));
  };

  const onSelectAnswer = (detailItem: any, questionPosition: number, selected: string, part6Index: number) => {
    let arr = testList || [];
    if (arr[part6Index].questions[questionPosition].selected != selected) {
      arr[part6Index].questions[questionPosition].selected = selected;
    } else {
      arr[part6Index].questions[questionPosition].selected = undefined;
    }
    updateDatabase(testName, arr);
  };

  const onReset = () => {
    let arr = testList || [];
    for (let test of arr) {
      test.isShownTranslate = false;
      const questions = (test.questions) ? test.questions : [];
      for (const question of questions) {
        const item = question;
        if (item) {
          item.submitted = false;
          item.selected = false;
        }
      }
    }
    updateDatabase(testName, arr);

    setCorrectNumber(-1);
  };

  const onSubmit = () => {
    calculateScore();
    let arr = testList || [];
    for (let test of arr) {
      const questions = (test.questions) ? test.questions : [];
      for (const question of questions) {
        const item = question;
        if (item && item.selected) {
          test.isShownTranslate = true;
          item.submitted = true;
        }
      }
    }
    updateDatabase(testName, arr);
  };

  const calculateScore = () => {
    let wrongCount = 0;
    let correctCount = 0;
    let count = 0;
    let listChoose: Choose[] = [];
    for (const test of testList) {
      const questions = (test.questions) ? test.questions : []; 
      let chooseType = Choose.INCORRECT;
      let allNone = true;
      let allCorrect = true;
      for (const question of questions) {
        count += 1;
        const item = question.data;
        if (item && item.selected) {
          if (item.selected == item.correct) {
            correctCount += 1;
            allNone = false;
          } else {
            wrongCount += 1;
            allCorrect = false;
            allNone = false;
          }
        } else {
          allCorrect = false;
        }
      }
      if (questions.length > 0 && allCorrect) {
        chooseType = Choose.CORRECT;
      } 
      if ((questions.length == 0) || (questions.length > 0 && allNone)) {
        chooseType = Choose.NONE;
      }
      listChoose.push(chooseType);
    }
    setChooseList(listChoose);
    setWrongNumber(wrongCount);
    setCorrectNumber(correctCount);
    setTotalNumber(count);
  };

  const renderItem = ({ index }: { item: any; index: number }) => {
    const item = testList[index];
    return (
      <Part6Item
        data={item}
        part6Index={index}
        visibleIndex={1}
        onSelectAnswer={onSelectAnswer}
        onCollapse={() => null}
        onCollapseTranslation={() => null}
      />
    );
  };

  return (
      <Screen canBack title={`Test ${testNumber} - Part 6`} showMenu>
        <TestFlatList
          data={testList}
          renderItem={renderItem}
          keyExtractor={(item, index) => `${index}_${item}`}
        />
        <Footer correctNumber={correctNumber} totalNumber={totalNumber} onReset={() => onReset()} onSubmit={() => onSubmit()} />
      </Screen>
  );
};

export default Part6;
